import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const AdminNavbar = () => {
    const { logout } = useAuth();
    const navigate = useNavigate();

    const handleLogout = () => {
        logout(); // Call the logout function
        navigate('/login'); // Redirect to the login page
    };

    return (
        <nav style={{ backgroundColor: '#4CAF50', color: '#fff', padding: '10px' }}>
            <h3>Admin Dashboard</h3>
            <ul style={{ listStyle: 'none', display: 'flex', gap: '20px' }}>
                <li><Link to="/admin" style={{ color: '#fff' }}>Home</Link></li>
                <li><Link to="/admin/artists" style={{ color: '#fff' }}>Manage Artists</Link></li>
                <li><Link to="/admin/bookings" style={{ color: '#fff' }}>Manage Bookings</Link></li>
                <li>
                    <button onClick={handleLogout} style={{ color: '#fff', background: 'transparent', border: 'none', cursor: 'pointer' }}>
                        Logout
                    </button>
                </li>
            </ul>
        </nav>
    );
};

export default AdminNavbar;
